import 'bootstrap/dist/css/bootstrap.min.css';

function Counting({counts}){
    const elements = counts[0].map((el) =>
        <div className={'row'}>{el}</div>
    );
    return(
        <div className={'col'}>
            { elements }
        </div>
    )
}

export default Counting;
